function Navlinks () {

    const Navrouter = [["Home"], ["Blog"], ["Portafolio"],["About" ]]

    return(
        <div>
            <nav className="px-3" >
                {Navrouter.map(([title])=> (
                    <div>
                        <div className="text-left md:cursor-pointer">
                            <a className="py-0 rounded-lg px-1  text-black font-medium hover:bg-slate-100 hover:text-slate-900 ">{title}</a>
                        </div>
                    </div>
                ))}
            </nav>
        </div>
    )
}

export default Navlinks;
